INSERT INTO `product_images` (`id`, `product_id`, `img_front`, `img_back`, `img_right`, `img_left`, `product_desc`) VALUES
(2, 552, , , , , 'Introducing the sleek and versatile Urban Explorer Backpack - your ultimate companion for city adventures and beyond. Crafted with premium materials and thoughtful design, this bag seamlessly blends style and functionality.\r\n\r\nWith its ergonomic padded straps and breathable back panel, comfort is paramount, making it ideal for long commutes or spontaneous outings. Multiple compartments and pockets offer ample storage for all your essentials, from laptops and tablets to water bottles and snacks, keeping you organized on the go.\r\n\r\nWhether you\'re navigating bustling streets or escaping into nature, the Urban Explorer Backpack is designed to adapt to your lifestyle, ensuring you\'re always prepared for wherever your journey takes you.');
INSERT INTO `product_images` (`id`, `product_id`, `img_front`, `img_back`, `img_right`, `img_left`, `product_desc`) VALUES
(3, 553, , , , , 'Introducing the Wanderlust Weekender Duffel Bag - your passport to effortless travel in style. Crafted from durable yet lightweight materials, this spacious duffel is designed to accompany you on all your adventures, whether it\'s a weekend getaway or an extended trip abroad.\r\n\r\nWith its timeless design and rugged construction, the Wanderlust Weekender exudes sophistication while offering practicality. The main compartment boasts ample space for clothing, shoes, and travel essentials, while multiple interior and exterior pockets keep smaller items organized and easily accessible.\r\n\r\nEquipped with sturdy handles and a detachable shoulder strap, carrying your belongings has never been more convenient. Plus, its versatile design allows it to seamles');
INSERT INTO `product_images` (`id`, `product_id`, `img_front`, `img_back`, `img_right`, `img_left`, `product_desc`) VALUES
(4, 554, , , , , 'Step into comfort and style with our Brick Sandals - the epitome of laid-back luxury for sunny days. Crafted from premium materials, these sandals feature a contoured footbed and adjustable straps for a personalized fit and all-day support. Whether you\'re strolling along the beach or exploring city streets, the Brick Sandals are sure to become your go-to footwear choice for effortless summer style.');
INSERT INTO `product_images` (`id`, `product_id`, `img_front`, `img_back`, `img_right`, `img_left`, `product_desc`) VALUES
(5, 555, , , , , 'Elevate your ensemble with our chic and versatile Mule Shoes - the perfect blend of sophistication and comfort. Designed with a classic silhouette and premium leather construction, these slip-on shoes effortlessly transition from day to night. The cushioned insole and low stacked heel provide lasting comfort, while the sleek design adds a touch of elegance to any outfit. From office meetings to weekend brunches, step out in confidence with the timeless appeal of our Mule Shoes.');
INSERT INTO `product_images` (`id`, `product_id`, `img_front`, `img_back`, `img_right`, `img_left`, `product_desc`) VALUES
(6, 556, , , , , 'Make a statement with our Louis Shoes - a modern twist on a timeless classic. Crafted from supple leather and featuring a sleek pointed toe, these shoes exude sophistication and charm. The low block heel adds a touch of height without sacrificing comfort, making them perfect for all-day wear. Whether you\'re dressing up for a special occasion or adding a touch of polish to your everyday look, the Louis Shoes are sure to become a staple in your wardrobe rotation.');

